            var Id = $('#Items').val();
            var url = 'GetMasterItems?Id=' + Id;
            $.get(url).done(function (response) {

                if (response.status) {
                    var dt = response.data[0]; 
                    console.log(response.data);
                    $('#Category').val(dt.category);
                    $('#HargaSatuan').val(dt.harga);
                    $('#Unit').val(dt.unit);
                }

            }).fail(function (a, b, c) {
                alert(""Failed Get Data"");
            });

        }

